<?php

/**

给定一个二进制数组 nums ， 计算其中最大连续 1 的个数。



示例 1：

输入：nums = [1,1,0,1,1,1]
输出：3
解释：开头的两位和最后的三位都是连续 1 ，所以最大连续 1 的个数是 3.
示例 2:

输入：nums = [1,0,1,1,0,1]
输出：2


提示：

1 <= nums.length <= 105
nums[i] 不是 0 就是 1.
 **/

class Solution {

    /**
     * @param Integer[] $nums
     * @return Integer
     */
    function findMaxConsecutiveOnes($nums) {
        if(empty($nums)) return 0;
        if(count($nums) == 1) return $nums[0];

        //获取第一个1的位置
        $i = 0;
        for(; $i < count($nums); $i++){
            if($nums[$i] == 1){
                break;
            }
        }

        //$i为开始的1的下标,$j为结束的下标
        $j = $i + 1;
        $len = 0;
        while($j < count($nums) && $i < count($nums)){
            if($nums[$j] == 0){

                if( $len < ($j - $i)){      //如果当前j为0，先判断是否比之前大，比之前大，则赋值，否则则将i挪到j这部分，并从这个点往后找到第一个为1的地方

                    $len = $j - $i;

                    $i = $j;

                }else{
                    $i = $j;
                }

                for(;$i<count($nums);$i++,$j++){
                    if($nums[$i] == 1){
                        break;
                    }
                }
            }else{
                $j++;
            }
        }

        if($nums[$i] == 1 && $nums[$j-1] == 1 && $len < ($j - $i)){
            $len = $j - $i;
        }

        return $len;
    }
}

